import styled from "styled-components";

export const PageContainer = styled.div`
  padding-top: 60px;
  height: 100vh;
  display: flex;
  flex-direction: column;
  background-color: #f8f8f8;
`;

export const Title = styled.h3`
  color: #00008b;
  font-size: 3rem;
  font-weight: bold;
  margin-bottom: 2rem;
`;

export const ProfileContainer = styled.div`
  display: flex;
  flex-direction: column;
  width: 60%;
  margin-left: 20%;
  // align-items: center;
  // align-self: center;
`;
